import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

interface Props {
    [key: string]: any;
    // data: string[],
    // isActive: boolean
    // element: { id: string, age: number},
    // action: ()=> void,
    //callback: <T>(data: {[key: string]: any}) => T ,
}
// oggetto di ritorno -> callback<string>({id: 0});

const ChildOne = (props: Props): JSX.Element => {
    //console.log('I \'m ChildOne')

    return <>
        <div>
            <section>
                <Container>
                    <Row>
                        <Col md={{ span: 3, offset: 3 }}>
                            <ul>
                                <li>lista nome 0</li>
                                <li>lista nome 1</li>
                                <li>lista nome 2</li>
                                <li>lista nome 3</li>
                                <li>lista nome 4</li>
                            </ul>
                        </Col>
                    </Row>
                </Container>
            </section>
        </div>
    </>
}
export default ChildOne
